// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ProfessorDashboard from './components/ProfessorDashboard/ProfessorDashboard';
import MenuDrawer from './components/MenuDrawer'; // Importando o Menu Drawer
import { Box } from '@mui/material';

const App = () => {
  return (
    <Router>
      <Box sx={{ display: 'flex' }}>
        <MenuDrawer /> {/* Adicionando o Menu Drawer */}
        <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
          <Routes>
            <Route path="/" element={<ProfessorDashboard />} /> {/* Rota inicial */}
            {/* Outras rotas podem ser adicionadas aqui */}
          </Routes>
        </Box>
      </Box>
    </Router>
  );
};

export default App;
